import React from "react";
import styled from "styled-components";
import UseNavigation from "./UseNavigation";

const Home = () => {

    const handleLinkClick = (url) => {
        if (url !== '사이트') {
            window.open(url, '_blank');
        }
    };

    const { goToHome, goToProfile, goToProject, goToContact } = UseNavigation();

    return (
        <>
            <BackgroundImage>
                <BackArea>
                    <BackBorder>
                        <BackColor>
                            <Bind>
                                {/* <Visit>TODAY <Visit2>11</Visit2> | TOTAL 1113</Visit>
                                <Bind2>
                                    <HomePage>이재호의 미니홈피</HomePage>
                                    <Link>
                                        <a href="https://jaeho13.github.io">https://jaeho13.github.io</a>
                                    </Link>
                                </Bind2> */}
                            </Bind>

                            <Bind3>
                                <Left>
                                    <LeftTop>
                                        <LeftTopImage src="/background/Picture.png" alt="profile" />
                                    </LeftTop>
                                    <LeftCenterComment>Introduce</LeftCenterComment>
                                    <LeftCenter>
                                        프론트엔드 개발자를 꿈꾸는 이재호입니다.<br />
                                        사용자 경험을 고려한 직관적이고 효율적인 인터페이스를 디자인하고 개발하는 것에 관심이 많습니다. <br />
                                    </LeftCenter>
                                    <LeftBottomComment>
                                        Link
                                    </LeftBottomComment>
                                    <LeftBottom>
                                        <Choice onChange={(e) => handleLinkClick(e.target.value)}>
                                            <option value="사이트">깃허브 및 블로그</option>
                                            <option>https://github.com/jaeho13</option>
                                            <option>https://velog.io/@jaehooo13</option>
                                        </Choice>
                                    </LeftBottom>
                                </Left>
                                <Center>
                                    <CenterTop>Commit Status
                                        <CenterTop2>
                                            <CenterTop2Image src="https://ghchart.rshah.org/jaeho13" />
                                        </CenterTop2>
                                    </CenterTop>
                                    <CenterMiddle>Miniroom</CenterMiddle>
                                    <CenterBottom>
                                        <CenterBottomImage src="/background/study.png" alt="study" />
                                    </CenterBottom>
                                </Center>
                                <Right>
                                    <RightButton1 onClick={goToHome}>Home</RightButton1>
                                    <RightButton2 onClick={goToProfile}>Profile</RightButton2>
                                    <RightButton3 onClick={goToProject}>Project</RightButton3>
                                    <RightButton4 onClick={goToContact}>Contact</RightButton4>
                                </Right>
                            </Bind3>
                        </BackColor>
                    </BackBorder>
                </BackArea>
            </BackgroundImage>
        </>
    );
};

export default Home;

const BackgroundImage = styled.div`
    background-color: #a3a3a3;
    background-image: url(/background/pattern.png);
    background-size: 100px;
    position: fixed;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    display: flex;
    justify-content: center;
    align-items: center;
`

const BackArea = styled.div`
    width: 70%;
    height: 85vh;
    border: 2px solid #738186;
    border-radius: 30px;
    background-color: #b4d1da;
    display: flex;
    justify-content: center;
    align-items: center;
`

const BackBorder = styled.div`
    width: 97%;
    height: 80vh;
    border: 3.5px dashed white;
    border-radius: 15px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const BackColor = styled.div`
    width: 97%;
    height: 75vh;
    border: 2px solid #d4d4d4;
    border-radius: 1rem;
    background-color: #d4d4d4;
`

const Bind = styled.div`
    display: flex;
    flex-direction: row;
    /* margin-top: 0.8rem; */
`

const Bind2 = styled.div`
    width: 70%;
    display: flex;
    flex-direction: row;
    margin-top: 1rem;
    /* justify-content: space-between; */
`

const Bind3 = styled.div`
    display: flex;
    flex-direction: row;
`

const Visit = styled.div`
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    width: 20%;
    height: 1.5rem;
    /* border: 2px solid blue; */
    margin-left: 1.5rem;
    font-size: 1.2rem;
    padding-top: 10px;
    display: flex;
    align-items: center;
    justify-content: center;
`

const Visit2 = styled.div`
    color: red;
    margin-left: 0.5rem;
    margin-right: 0.5rem;
`


const HomePage = styled.div`
    width: 80%;
    height: 2rem;
    /* border: 2px solid black; */
    margin-left: 2.5rem;
    font-size: 1.5rem;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
`

const Link = styled.div`
    width: 80%;
    height: 2rem;
    /* border: 2px solid green; */
    margin-left: 10rem;
    margin-right: 6rem;
    font-size: 1.15rem;
    display: flex;
    justify-content: right;
    align-items: center;
    color: grey;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    color: #3B87AB
`

const Left = styled.div`
    width: 20%;
